  false,\n\t\"url\": null,\n\t\"notes\": \"This raster data set represents water-level
  change in the High Plains aquifer of the United States from 2000 to 2005, in feet.
  The High Plains aquifer underlies 112.6 million acres (176,000 square miles) in
  parts of eight States: Colorado, Kansas, Nebraska, New Mexico, Oklahoma, South Dakota,
  Texas, and Wyoming. Water-level declines occurred in parts of the High Plains aquifer
  soon after the onset of substantial irrigation with groundwater (about 1950). This
  data set was generated in ESRI ArcInfo Workstation Version 9.3, which is a geographic
  information system (GIS), using water-level-change data from wells measured in 2000
  and 2005 and from some additional wells in New Mexico, which were measured in 2001,
  2002, 2006, and 2007. For this data set, areas of no substantial change were designated
  as areas where water-level change was between a rise of 1 foot and a decline of
  1 foot; the raster was set to zero in the areas of no substantial change.\",\n\t\"license_title\":
